//의미있는 단위로 컴포넌트를 나눠주면 된다. 
const Home = () => {
  const {isLoggedIn} = useSelector((state) => state.user);
  return (
    <AppLayout>
      <PostForm />
      <PostCard />
    </AppLayout>
  );
}

export default Home;
